POLO CPI has been providing Commercial and Private Inquiry Agent services across Australia and overseas since 1994. The organisation is an Australian owned and operated private company that has built its reputation as a leading process service, surveillance and investigations service provider to organisations in the legal, insurance, government and banking sectors. We believe our success and continued growth is due to our turnaround times, rigorous quality assurance, professional Licenced field agents combined with a streamlined and cost effective delivery.

POLO CPI has extensive experience in providing the following services:
1.	Process Service
2.	Urgent Process Service 
3.	Hard Process Service
4.	Preparation of affidavits and written evidence for court;
5.	Field Calls including discrete field calls;
6.	Background searches (e.g. title searches) 
7.	Enquiries, including discrete enquiries;
8.	Location of witness/debtors/defendants - skip tracing;
9.	Surveillance and commercial investigations relating to service of documents and legal and government matters.

