Following the creation of Viva Energy as exclusive licensee of Shell products in Australia, I was appointed to lead pricing strategy and modelling for the Coles Express Alliance with a focus on strengthening retail margins and competitive positioning. Managing a lean pricing team and providing leadership to ~40 across sales and account management, I review and manage pricing for 700 national sites, working across internal and external management and legal teams to ensure future sustainability.  
•	Reduced price exposure significantly through effective contract management and review;
•	Recognised advocate for flexible working having successfully job shared with a partner in Queensland for 6 years: vivaenergy.com.au/driven/people/how-a-flexible-working-arrangement-works-for-us.

A key partner to commercial sales, I developed and implemented pricing strategies across a multibillion-dollar portfolio, focusing on delivering sustainable and profitable growth. With oversight of >50 business contracts supplying billions of dollars in fuel each month, I managed a team of 10 and ensured the delivery of all agreed T&Cs. Working with a commodity product, a major part of this role was continually reviewing pricing models in line with cost fluctuations, supporting staff to engage positively with customers to communicate changes. I was also a member of the Tender Committee and supported bid price structure and commercial review. 

•	Identified a significant gap in exposure due to pricing changes, closing this by 87.5% by end of tenure;
•	Achieved and maintained 100% price correctness in ERP;
•	Contributed to the implementation of a new SAP system as a pricing SME, engineering streamlined pricing schemes and managing all change communications with customers.

Providing strategic leadership and operational advice to over 800 dealer-owned, unmanned and Coles Express sites, I created actionable initiatives that drove a customer focus while ensuring 100% compliance with various environmental standards. Managing a team of 6 SMEs, I provided an overall vision to establish a culture of service excellence and a ‘right first time’ mind-set. Key to this role was developing a strong understanding of external regulations to protect the integrity of the company and facilitate maximum business value.

•	Increased demand forecasting accuracy by 3% through establishment of a continuous improvement community, receiving the Downstream Bridge Award in recognition of achievement;
•	Increased sales volume by 5% through the ‘People Make the Difference’ staff incentive program;
